et.seed(123)\n","split = sample.split(ds$Customer_Segment, SplitRatio = 0.8)\n","train_set = subset(ds, split == TRUE)\n","test_set = subset(ds, split == FALSE)\n","\n","#Feature Scaling\n","\n","train_set[-14] = scale(train_set[-14])\n","test_set[-14] = scale(test_set[-14])\n","\n","#Implementing the LDA Model\n","library(MASS)\n","lda = lda(formula = Customer_Segment ~ ., data = train_set)\n","train_set = as.data.frame(predict(lda, train_set))\n","test_set = as.data.frame(predict(lda, test_set))\n","print(head(train_set))\n","print(head(test_set))\n","train_set = train_set[c(5, 6, 1)]\n","test_set = test_set[c(5, 6, 1)]\n","print(head(train_set))\n","print(head(test_set))"]},{"cell_type":"markdown","id":"169b6b75","metadata":{"papermill":{"duration":0.118091,"end_time":"2022-03-24T17:40:44.746018","exception":false,"start_time":"2022-03-24T17:40:44.627927","status":"completed"},"tags":[]},"source":["#### **Building & Training the Support Vector Classification model on the Linear Discriminant Train set**"]},{"cell_type":"code","execution_count":17,"id":"64af0921","metadata":{"execution":{"iopub.execute_input":"2022-03-24T17:40:44.985555Z","iopub.status.busy":"2022-03-24T17:40:44.984034Z","iopub.status.idle":"2022-03-24T17:40:45.040707Z","shell.execute_reply":"2022-03-24T17:40:45.039293Z"},"papermill":{"duration":0.177268,"end_time":"2022-03-24T17:40:45.040839","exception":false,"start_time":"2022-03-24T17:40:44.863571","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["   y_pred\n","     1  2  3\n","  1 12  0  0\n","  2  1 13  0\n","  3  0  0 10\n","Accuracy of LDA Support Vector Classification Model is: 0.9722222"]},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 3 × 3</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>precision</th><th scope=col>recall</th><th scope=col>f1</th></tr>\n","\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</t